import React ,{useState} from 'react'
import '../CSS/GofundNFT.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import calculadora from "../images/calculadora.png";

function Calculadora(){

    const [qtdUsers, setqtdUsers] = useState();
    const [valorUsers, setValorToken] = useState();
    const [conversao, setPorcentagem] = useState();


    const submit = (e) => {
        e.preventDefault();

    if (qtdUsers === "" || valorUsers === "" || conversao === "") {
        return false;
    }


    const usuariosComprados = ( parseInt(conversao) / 100 ) * parseInt(qtdUsers)

    const resultadoCompra = usuariosComprados * parseInt(valorUsers) 
    

    document.getElementById("resultado").innerHTML = resultadoCompra;
    };

    return (
    <div class="container " style={{marginTop:'80px'}}>          
        <div class="row">
            <div  class="col-lg-8 col-md-8 col-sm-12" >
                <div class="row" style={{textAlign:'center'}}>
                   <div style={{marginTop:'20px'}}>
                    <h3 className="gradient" style={{fontWeight:'700', fontSize:'30px'}}>
                        CALCULADORA DE SIMULAÇÃO DE CAPTAÇÃO
                    </h3>
                   </div>
                </div>
                
            <div class="row" style={{ textAlign:'center', marginTop:'60px'}} id="divFormulario">
                    <form onSubmit={submit} style={{display:'inline-flex'}}>
                        <div class="col-3">
                            <input className="gradient"  placeholder="Digite aqui" value={qtdUsers} onChange={(e) => setqtdUsers(e.target.value)}/>
                            
                            <p style={{fontWeight:'500', fontSize:'16px'}}>Quantidade de seguidores</p>
                        </div>
                    
                        <div class="col-3" >
                            <div style={{display:'flex',backgroundColor:'blue',width:'80%'}}>
                                <span className="gradient" style={{fontSize:'28px',fontWeight:'700',marginLeft:'40px'}} >R$</span>
                                <input type="text" className="gradient" placeholder="" value={valorUsers} onChange={(e) => setValorToken(e.target.value)}/>
                            </div>
                        
                            <p style={{fontWeight:'500', fontSize:'16px'}}>Valor do token</p>
                        </div>
                        
                        <div class="col-3" >
                        <div style={{display:'flex'}}>
                                
                                <input className="gradient" placeholder="" value={conversao} onChange={(e) => setPorcentagem(e.target.value)}/>
                                <span className="gradient" style={{fontSize:'28px',fontWeight:'700',marginLeft:'40px'}} >%</span>
                       </div>
                        <p style={{fontWeight:'500', fontSize:'16px'}}>Percentual de conversão de compra</p>
                        </div>
                    
                        <div class="col-3">
                        <p className="gradient" style={{fontWeight:'700', fontSize:'26px'}}>R$
                             <label id="resultado" className="gradient" style={{fontWeight:'700', fontSize:'26px'}}>0</label>
                        </p>
                            <p style={{fontWeight:'500', fontSize:'16px', marginTop:'-10px', marginBottom:'0px'}}>Total arrecadado</p>

                            <button id="BtnCalculadora" type="submit">Calcular</button>

                        </div>
                    </form>
                </div>
            </div> 
            
             
            <div  class="col-lg-4 col-md-4 col-sm-12">
                <img  style={{height:'100%'}}             
                                    src={calculadora} 
                                    class="img-fluid"  
                                    alt="FundoGoTokens"
                                    
                                    >
                </img> 
            </div> 
        </div>        
    </div>
        
    );
}

export default Calculadora;
